// Insert custom deck dealing code here
EffectAreas.reset();
CardStacks.active[0].shuffle();

const pyramidHeight = 7; // Levels in pyramid
const center = parseInt(GAME_INFO.gameWidth / 2); // Canvas center
const startY = 0;
for (let y = pyramidHeight; y >= 1; y--) {
    const startX = center - GAME_INFO.defaultCardWidth * (y / 2);

    for (let x = 0; x < y; x++) {
        const draw = CardStacks.active[0].separate(1);
        const left = startX + x * GAME_INFO.defaultCardWidth;
        const top = startY + y * parseInt(GAME_INFO.defaultCardHeight / 2);
        draw.setPos({x: left, y: top});
    }
}
